import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col } from 'react-bootstrap';

function Notes() {
  return (
    <Container className="mt-5">
      <Row>
        <Col className="bg-danger p-2 text-white bg-opacity-50" xs={4}>
          {/* Content for the first column */}
          <h2>Column 1</h2>
          <p>This is the first column with a light background.</p>

          <div className="card" style="width: 18rem;">
          <div className="card-body">
            <h5 className="card-title">Card title</h5>
            <h6 className="card-subtitle mb-2 text-body-secondary">Card subtitle</h6>
            <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
            <a href="#" className="card-link">Card link</a>
            <a href="#" className="card-link">Another link</a>
          </div>
        </div>





        </Col>
        <Col className="bg-warning p-2 text-white bg-opacity-50" xs={4}>
          {/* Content for the second column */}
          <h2>Column 2</h2>
          <p>This is the second column with a light green background.</p>
        </Col>
        <Col className="bg-success p-2 text-white bg-opacity-50" xs={4}>
          {/* Content for the third column */}
          <h2>Column 3</h2>
          <p>This is the third column with a light blue background.</p>
        </Col>
      </Row>
    </Container>
  );
}

export default Notes;
